Description:
[Các dev nên để CV lại để process đc nhanh hơn nhé] 
Bên mình vẫn cần ứng viên nhé 
Windows Applications Developer 
Lương : Thoả thuận 
Yêu cầu: 
• C# development for .NET applications (WPF); 
• WPF/XAML using MVVM pattern; 
• SQL, LINQ, Entity Framework; 
• Strong knowledge of Multi-threading, TPL, async/await; 
• UI/UX Design for .NET/WPF applications; 
Địa điểm làm việc: remote 
Ngân sách: như bên dưới + bonus

Mô tả công việc 
- Tham gia thực hiện việc thiết kế, tùy chỉnh, phát triển ứng dụng và tích hợp hệ thống trên các dịch vụ nền tảng của Salesforce; 
- Phân tích và làm rõ các nhu cầu của khách hàng; 
- Nghiên cứu, tìm hiểu các tính năng của Salesforce để đáp ứng cho khách hàng các giải pháp toàn diện; 
- Training cho các thành viên mới. 
- Flexible time (tối thiểu 4h/ngày)

Mô tả công việc: 
- Lên kế hoạch và thực hiện việc SEO cho các keywords cho 1 số ngành hàng mới của công ty; 
- Nghiên cứu các keywords phù hợp cho mục tiêu của business; 
- Thực hiện các công việc của SEO (bao gồm tối ưu on page, internal links, backlinks..); 
- Soạn thảo và tối ưu nội dung bài listing cho các SKU và ngành hàng mới, và viết các bài blog để tăng ranks cho các keywords; 
Yêu cầu công việc: 
- Kinh nghiệm vững về SEO (ít nhất 2 năm kinh nghiệm ở vị trí SEO - hiểu rõ các kỹ thuật, cách triển khai, với kết quả cụ thể); 
- Kinh nghiệm về local SEO là lợi thế; 
- Có kiến thức về marketing, nghiên cứu thị trường, đối thủ, lập kế hoạch marketing; 
- Khả năng hiểu và viết tốt về sản phẩm trong lĩnh vực kinh doanh của công ty (thiết bị khoá cửa thông minh, thiết bị gia dụng thông minh) 
- Có laptop cá nhân; 
- Tuần làm việc 20h: có thể làm ở nhà/ buổi tối miễn đảm bảo tiến độ và kết quả; Riêng thứ 7 lên làm việc tại công ty (Từ 8h-17h30, trưa nghỉ 1,5 tiếng từ 12h - 13h30); 
- Vị trí này open cho các bạn đang làm công việc về SEO, performance marketing, digital marketing.. muốn tìm thêm 1 công việc ngoài giờ. 
Quyền lợi: 
- Thu nhập : 6.000.000 vnđ - 10.000.000 vnđ /tháng (có thưởng thêm theo kết quả và sự gắn bó); 
Địa chỉ công ty: 60 Hòa Bình - Phường 5 - Quận 11 - TP Hồ Chí Minh
